-- TOC entry 322 (class 1255 OID 18955)
-- Name: calculate_budget_reel(); Type: FUNCTION; Schema: public; Owner: -
--

CREATE FUNCTION public.calculate_budget_reel() RETURNS trigger
    LANGUAGE plpgsql
    AS $$
BEGIN
    -- Calculer le budget rel comme somme des honoraires et dbours
    NEW.budget_reel = COALESCE(NEW.montant_honoraires, 0) + COALESCE(NEW.montant_debours, 0);
    RETURN NEW;
END;
$$;


--
-- TOC entry 349 (class 1255 OID 19038)
-- Name: calculate_invoice_totals(); Type: FUNCTION; Schema: public; Owner: -
--

CREATE FUNCTION public.calculate_invoice_totals() RETURNS trigger
    LANGUAGE plpgsql
    AS $$
DECLARE
    invoice_id_param UUID;
    total_ht DECIMAL(15,2) := 0;
    total_tva DECIMAL(15,2) := 0;
    total_ttc DECIMAL(15,2) := 0;
BEGIN
    -- Dterminer l'ID de la facture
    IF TG_OP = 'DELETE' THEN
        invoice_id_param := OLD.invoice_id;
    ELSE
        invoice_id_param := NEW.invoice_id;
    END IF;
    
    -- Calculer les totaux  partir des lignes de facture
    SELECT 
        COALESCE(SUM(montant_ht), 0),
        COALESCE(SUM(montant_tva), 0),
        COALESCE(SUM(montant_ttc), 0)
    INTO total_ht, total_tva, total_ttc
    FROM invoice_items 
    WHERE invoice_id = invoice_id_param;
    
    -- Mettre  jour la facture
    UPDATE invoices 
    SET 
        montant_ht = total_ht,
        montant_tva = total_tva,
        montant_ttc = total_ttc,
        updated_at = CURRENT_TIMESTAMP
    WHERE id = invoice_id_param;
    
    -- Retourner le bon record selon l'opration
    IF TG_OP = 'DELETE' THEN
        RETURN OLD;
    ELSE
        RETURN NEW;
    END IF;
END;
$$;


