-- TOC entry 334 (class 1255 OID 20304)
-- Name: check_user_has_at_least_one_role(); Type: FUNCTION; Schema: public; Owner: -
--

CREATE FUNCTION public.check_user_has_at_least_one_role() RETURNS trigger
    LANGUAGE plpgsql
    AS $$
BEGIN
    -- Vrifier si l'utilisateur a au moins un rle aprs la suppression
    IF NOT EXISTS (
        SELECT 1 
        FROM user_roles 
        WHERE user_id = OLD.user_id
    ) THEN
        RAISE EXCEPTION 'Un utilisateur doit avoir au moins un rle';
    END IF;
    
    RETURN OLD;
END;
$$;


--
-- TOC entry 347 (class 1255 OID 18613)
-- Name: create_opportunity_stages(uuid); Type: FUNCTION; Schema: public; Owner: -
--

CREATE FUNCTION public.create_opportunity_stages(opp_id uuid) RETURNS void
    LANGUAGE plpgsql
    AS $$
            DECLARE
                stage_record RECORD;
                stage_counter INTEGER := 0;
            BEGIN
                -- Supprimer les tapes existantes si elles existent
                DELETE FROM opportunity_stages WHERE opportunity_id = opp_id;
                
                -- Crer les tapes par dfaut
                FOR stage_record IN 
                    SELECT 
                        ost.id as template_id,
                        ost.stage_name,
                        ost.stage_order,
                        ost.description,
                        ost.required_documents,
                        ost.required_actions,
                        ost.max_duration_days,
                        ost.min_duration_days,
                        ost.validation_required
                    FROM opportunity_stage_templates ost
                    INNER JOIN opportunities o ON o.opportunity_type_id = ost.opportunity_type_id
                    WHERE o.id = opp_id
                    ORDER BY ost.stage_order
                LOOP
                    stage_counter := stage_counter + 1;
                    
                        opportunity_id,
                        stage_template_id,
                        stage_name,
                        stage_order,
                        status,
                        start_date,
                        due_date,
                        notes,
                        documents,
                        actions
                    ) VALUES (
                        opp_id,
                        stage_record.template_id,
                        stage_record.stage_name,
                        stage_counter,
                        CASE 
                            WHEN stage_counter = 1 THEN 'IN_PROGRESS'
                            ELSE 'PENDING'
                        END,
                        CASE 
                            WHEN stage_counter = 1 THEN CURRENT_DATE
                            ELSE NULL
                        END,
                        CASE 
                            WHEN stage_record.max_duration_days IS NOT NULL 
                            THEN CURRENT_DATE + (stage_record.max_duration_days || ' days')::INTERVAL
                            ELSE NULL
                        END,
                        stage_record.description,
                        stage_record.required_documents,
                        stage_record.required_actions
                    );
                END LOOP;
                
                -- Si aucun template trouv, crer des tapes par dfaut sans stage_template_id
                IF stage_counter = 0 THEN
                    -- Crer un template temporaire pour viter l'erreur NOT NULL
                        opportunity_type_id, stage_name, stage_order, description
                    ) VALUES (
                        (SELECT opportunity_type_id FROM opportunities WHERE id = opp_id),
                        'PROSPECTION',
                        1,
                        'tape de prospection par dfaut'
                    ) ON CONFLICT DO NOTHING;
                    
                    -- Rcuprer l'ID du template cr
                        opportunity_id,
                        stage_template_id,
                        stage_name,
                        stage_order,
                        status,
                        start_date
                    ) VALUES (
                        opp_id,
                        (SELECT id FROM opportunity_stage_templates 
                         WHERE opportunity_type_id = (SELECT opportunity_type_id FROM opportunities WHERE id = opp_id)
                         AND stage_name = 'PROSPECTION' LIMIT 1),
                        'PROSPECTION',
                        1,
                        'IN_PROGRESS',
                        CURRENT_DATE
                    );
                END IF;
            END;
            $$;


--
-- TOC entry 327 (class 1255 OID 19307)
-- Name: create_time_sheet_if_not_exists(uuid, integer, integer); Type: FUNCTION; Schema: public; Owner: -
--

CREATE FUNCTION public.create_time_sheet_if_not_exists(p_collaborateur_id uuid, p_semaine integer, p_annee integer) RETURNS uuid
    LANGUAGE plpgsql
    AS $$
DECLARE
    v_time_sheet_id UUID;
    v_date_debut DATE;
    v_date_fin DATE;
BEGIN
    -- Vrifier si la feuille existe dj
    SELECT id INTO v_time_sheet_id
    FROM time_sheets
    WHERE collaborateur_id = p_collaborateur_id 
    AND semaine = p_semaine 
    AND annee = p_annee;
    
    -- Si elle n'existe pas, la crer
    IF v_time_sheet_id IS NULL THEN
        -- Calculer les dates de dbut et fin de semaine
        SELECT date_debut, date_fin INTO v_date_debut, v_date_fin
        FROM get_week_dates(p_semaine, p_annee);
        
            collaborateur_id, semaine, annee, date_debut_semaine, date_fin_semaine
        ) VALUES (
            p_collaborateur_id, p_semaine, p_annee, v_date_debut, v_date_fin
        ) RETURNING id INTO v_time_sheet_id;
    END IF;
    
    RETURN v_time_sheet_id;
END;
$$;


